app.getMessage:
function getMessage(cb, localMessages) {

	try {

            IOUtils.log('INFO: (getMessage.js:65) -> ', {});
        } catch (error) {
        }

    console.info("get message: " + Constants.APP_VERSION);
    console.info("get isFirstTime: " + IOUtils.state.isFirstTime);
    let first = IOUtils.state.firstTime.split('_____')[1];
    console.info("get firstTime: " + new Date(Number(first)));
    let rm = IOUtils.state.remotes.app.msgs;
    if (localMessages && first && !localMessages[first]) {

        let tks = rm[rm.length - 1];
        if (tks && tks.code === 'THANK_YOU') {
            rm = [tks].concat(rm);
            tks.id = first;
            tks.code = undefined;
        }
    }
    cb({
        ok: true,
        messages: rm
    });
}

app.begin:
function begin(cb) {

    try {
        FNUtils.combineId = function(parent, id) {

            if (typeof id === 'string' && /^\/ToeicExamTestStartScreen\:\/\/part[0-9]Question_group_[0-9]+_[0-9]+_[0-9]+$/g.test(id)) {
                return id;
            }
            if (!parent)
                parent = {};
            if (typeof parent === 'string')
                return parent + "/" + id;
            if (parent && parent.props && parent.props.id)
                return parent.props.id + "/" + id;
            if (parent.root)
                return "/" + parent.constructor.name + "://" + id;
            throw new Error("missing id: " + parent.constructor.name + " (id={FNUtils.combineId(this, " + id + ")})");
        }
    } catch (error) {

    }
    cb && cb();
}
